import React, { Component } from "react";
import { SafeAreaView, View, TextInpt } from "react-native";
import { CustomHeader } from "../../index";
import { Avatar, Button, Card, Title, Paragraph, TextInput } from 'react-native-paper';
export class ReportScreen extends Component {
  render() {
    return (
      <SafeAreaView style={{ flex: 1, backgroundColor: "#39D5D5" }}>
        <CustomHeader title="REPORT" navigation={this.props.navigation} />
        <View style={{margin:20}}>
          <Card>
            <Card.Title
              title="Report Problem"
              subtitle="แจ้งปัญหาหรือสามารถสอบถามได้ที่นี่"
            />
            <Card.Content>
              <Title>Card title</Title>
              <Paragraph>
              <TextInput
      label="Email"
      value={text}
      onChangeText={text => setText(text)}
    />
                  </Paragraph>
            </Card.Content>
            <Card.Cover source={{ uri: "https://picsum.photos/700" }} />
            <Card.Actions>
              <Button>Cancel</Button>
              <Button>Ok</Button>
            </Card.Actions>
          </Card>
        </View>
      </SafeAreaView>
    );
  }
}
